INSERT INTO `posts` (`id`, `titulo`, `post`, `idEscritor`, `escritor`, `data`, `status`) VALUES
(2, 'Me apresentando', 'Olá pessoal! Eu sou Steph Hoel e espero que curtam este meu novo projeto!<br><br>Vou publicar aqui informações, revoltas e outras coisas que não postarei no youtube! Enquanto não tem nada novo por aqui, passem lá na área de vídeos e assista meus últimos vídeos! Meus dois canais estão lá!<br><br>E pra não ficar só na "publicidade gratuita", aí vai informações:<br><br><b>Justiça de SP manda Facebook pagar R$ 10 mil a empresário por perfil "fake"</b><br><a style="color:darkblue;" onclick="javascript:window.open(''http://g1.globo.com/tecnologia/noticia/2015/09/justica-de-sp-manda-facebook-pagar-r-10-mil-empresario-por-perfil-fake.html'',''_blank'')" target="_blank">Notícia tirada do G1</a><br><br>O que mais me chamou atenção foi justamente este título. Lendo a reportagem (link logo abaixo do título) descobri que não é bem assim como o título deixa a entender :/ <br>O que acontece é o simples fato de haver página(s) falsa(s) da empresa e perfil de um de seus empresários. Foi pedido para retirarem, mas pelo o que entendi não usaram os caminhos comuns do Facebook (denúncia de ilegitimidade) e tentaram um acordo extrajudicial diretamente com a representante brasileira do FB, sendo esta apenas a representante e não a empresa que "comanda" o grupo. <br>Ahh... Nada como falta de conversa e tentar não pular as normas...<br><br><br>Eu até ia falar de mais, mas só isso já cansou rs<br>Espero que tenham gostado! :*<br><b>Até a próxima pessoal!!!</b>', 1, 'Steph Hoel', '2015-09-03', 'publicado'),
(4, 'Testando isso aqui', 'Estou com um novo sistemas de postagem e estou testando só para ver como vai ficar.<p><b>Agora estou em negrito.</b></p><p>Agora saí do negrito.</p><p><i>Agora estou em itálico.</i></p><p><u>Saindo do itálico para o sublinhado.</u></p><p><i><b><u><strike>Agora usando tudo.</strike></u></b></i></p>', 1, 'Steph Hoel', '2015-09-07', 'editando'),
(5, 'Participação especial!', '<p style="text-align: left;">E aí pessoal?! Estou aqui pelo simples motivo de: fiz participação de plano de fundo num vídeo!!</p><p style="text-align: left;">Ebaaaaaaa!! o/</p><p style="text-align: left;">É ... Nem tão assim. Apareci apenas alguns segundos e tal, mas tô lá e venho aqui mostrar procês!</p><p style="text-align: left;"><a href="https://youtu.be/wKDtyYmPOSo">Clique aqui para ver o vídeo!!!</a></p><p style="text-align: left;">Espero que tenham gostado! Até mais!!! :*</p><p></p>', 1, 'Steph Hoel', '2015-09-15', 'publicado'),
(6, 'Volta do canal!', 'E aí pessoal?! Com a compra da câmera nova, estou voltando com os canais!<p>Sim! Terão vídeos novos! E serão às terças e quintas no canal <a href="https://www.youtube.com/user/stephanyetete">Steph Hoel</a> e às quartas no canal <a href="https://www.youtube.com/channel/UC5OH44XOGQPjrkx5uSd6GVw">Steph Yui Hoel</a>. Eventualmente em outros dias nesse último canal também!</p><p>E com isso, percebi o quão envergonhada de gravar na frente da minha mãe eu fico. Com as obras que estão fazendo na casa ao lado, só posso gravar à noite e... com a mãe dormindo, obviamente. A vergonha é tanta haha</p><p>Mas já tenho, nesse momento, 2 vídeos agendados e mais 1 para editar. Dia 1º de outubro começam os vídeos! E só por informação, dia 18 vou estar no evento LiteraCaxias, na cidade de Duque de Caixas, aqui no Rio de Janeiro.</p><p>E mais uma informação importante: não sou tão relapsa assim, então <b>Feliz Aniversário Mãe</b>!!!</p><p><br></p><p>E é isso pessoal! Abraços e fuiiiii :*</p>', 1, 'Steph Hoel', '2015-09-26', 'publicado'),
(7, 'Iniciativas nas comunidades, bom ou ruim?', '<p style="text-align: left;"></p><p style="font-size: 18px;"></p><span style="font-size:16px;undefined"><span style="font-size:18px;undefined"><p style="font-size: 18px;">É muito bom ver que as comunidades estão sendo amparadas pelo governo e outras instituições no quesito educação e é muito bom ver que os jovens terão a oportunidade de concorrer nas mesmas condições educacionais que o filhinho de papai.</p><p style="font-size: 18px;">Mas é deprimente ver que se você não mora nas comunidades, você quase não tem acesso à privilégios como este.</p><p style="font-size: 18px;">Ouço muito ser anunciado e divulgado cursos e capacitações profissionais para aqueles que moram exclusivamente em comunidades, mas e aqueles que moram nos outros bairros e não têm acesso à tudo isso?</p><p style="font-size: 18px;">Será mesmo que é só eles se deslocarem até às comunidades, quando conseguem se inscrever, isso se eles conseguem chegar, seja pela falta de transporte ou falta de condição financeira ou qualquer outro empecilho, e fazer o curso que terão uma chance?</p><p style="font-size: 18px;">Meu exemplo: eu morava na cidade de São João de Meriti, Baixada Fluminense, e consegui um curso pelo Pronatec que só tinha no Maracanã; acordar às 4 da manhã para chegar na hora, fazer uma viagem de duas horas em dois ônibus tendo que acrescentar dinheiro do bolso para pagar as passagens, fazer o curso todo e no final ficar com mais de 75% de frequência e média de 8 pra cima; isso tudo de segunda a sexta e estudando a noite.</p><p style="font-size: 18px;">Eu sinceramente não sei como consegui. E pra completar, no último semestre do curso, eu estava na faculdade, tinha mudado para um local muito mais longe (obviamente não porque eu queria) e dormindo menos de três horas por noite.</p><p style="font-size: 18px;">Se eu morasse numa comunidade, o curso seria quase que do lado de casa e não precisaria acordar 4 horas antes do início da aula. Isso é dar igualdade? Só os moradores de comunidades passam por dificuldades de ensino?</p><p style="font-size: 18px;">"Ah mas você podia não ter escolhido esse curso tão longe. Devia ter escolhido um curso mais perto de casa!"</p><p style="font-size: 18px;">Não discordo, se tivesse um mais perto de casa. Eu fiz Programação para Jogos Digitais focando no ensino de programação, se fizesse um curso de Informática, por exemplo, não seria tão proveitoso para o aprendizado que eu buscava.</p><p style="font-size: 18px;">Hoje eu vejo a diferença que isso fez na minha vida e que deve fazer na vida dos jovens de comunidade, mas tanto lá quanto em qualquer outro lugar deve ser preservado a igualdade e se ajudam a comunidade também deviam ajudar os outros jovens mesmo que não morem em locais de risco.</p><p style="font-size: 18px;"><br style="font-size: 18px;"></p><p style="font-size: 18px;">Esse foi apenas um desabafo meu,</p><p style="font-size: 18px;">S Hoelbriegel.</p></span><p style="font-size: 16px;"></p></span><p style="font-size: 18px;"></p><p></p>', 1, 'Steph Hoel', '2015-11-14', 'publicado'),
(8, 'Como nasceu o Vlogueiro Rebelde', '<p style="text-align: center;">Vlogueiro Rebelde, o Marcio Rebeldia</p><p><span style="text-align: left;">Em entrevista feita pelo Hangout com Vlogueiro Rebelde, Marcio Rebeldia nos contou mais sobre porque criou o canal.</span></p><p style="text-align: left; color: rgb(51, 51, 51);"><span style="color:rgb(255,153,0);text-align: left;">Steph Hoel</span>: Por que tu teve a ideia de usar "Rebelde" como "ajudante" pro teu canal? Eu sei que faz sentido o que tu fala com "ser rebelde", mas como brilhou aquela lampada na tua cabeça dizendo que essa era uma ideia legal?</p><p style="text-align: left; color: rgb(51, 51, 51);"><span style="color:rgb(255,0,0);text-align: left;">Marcio Rebeldia</span>: Eu tô nesse ramo desde 2006 quando passava a novela Rebelde. Tinha um blog com uma amiga que falava da novela e eu era o Marcio Rebeldia desde então. Daí em 2010 comecei a gravar vídeos falando sobre a novela, os atores e a banda RBD. Mas como briguei com essa garota, parei de gravar vídeos até voltar em 2013 com o canal Rebeldia Filmes. Enfim, o uso de Rebelde é porque gosto e desde a época da novela uso esse nome no orkut.</p><p style="text-align: left;"><br></p><p style="text-align: left;">E foi essa a explicação do por que o canal usar o "Rebelde" como caracteristica quase que principal :P</p><p style="text-align: left;"><a href="https://www.youtube.com/channel/UCBnyxFNT8fkOMftaA6hVk-w" style="text-align: left;">O canal Vlogueiro Rebelde pode ser acessado neste link aqui</a>', 0, 'Steph Hoel', '2015-11-17', 'publicado'),
(9, 'Mitologia Tupi e Mitologia Guarani', '<p style="text-align:justify;">A Mitologia Tupi-Guarani é da época pós colonização cristã, portanto tem muitas coisas que foram demonizadas da cultura Tupi.</p><br><p style="text-align:justify;">Eu sei que eu falo de cultura Tupi-Guarani no canal, mas isso não quer dizer que eu caia de paixão por ela, na verdade é porque tem mais conteúdo disponível do que a cultura Tupi.</p><br><p style="text-align:justify;">Na verdade mesmo, eu amaria ver muito mais conteúdo da Mitologia Tupi disponível, mas muito se perdeu por causa dos cristãos se achando os donos do mundo e muito se perdeu por falta da tradição da escrita nos nativos brasileiros.</p><br><p style="text-align:justify;">Acho até que seriamos melhores humanos se tivéssemos todo o conhecimento que eles tinham junto com o conhecimento que possuímos hoje em dia.</p><br><p style="text-align:justify;">Por fim, nos conheceríamos mais se tivéssemos a mente mais aberta a conhecer mais sobre nossos antepassados; o que faziam, porque faziam, no que acreditavam e porque acreditavam naquilo...</p><br><p style="text-align:justify;">E em contra proposta deveríamos fazer o mesmo conosco mesmos: o que fazermos, porque fazemos, no que acreditamos, porque acreditamos, o que deixaremos para o futuro de bom e de ruim...</p><br>', 0, 'Steph Hoel', '2016-08-11', 'editando'),
(10, 'Mitologia Tupi e Mitologia Guarani', '<p style="text-align: left;">A Mitologia Tupi-Guarani é da época pós colonização cristã, portanto tem muitas coisas que foram demonizadas da cultura Tupi.</p><p></p><p dir="ltr" style="text-align: left; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline;">Eu sei que eu falo de cultura Tupi-Guarani no canal, mas isso não quer dizer que eu caia de paixão por ela, na verdade é porque tem mais conteúdo disponível do que a cultura Tupi.</span></p><p dir="ltr" style="text-align: left; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline;">Na verdade mesmo, eu amaria ver muito mais conteúdo da Mitologia Tupi disponível, mas muito se perdeu por causa dos cristãos se achando os donos do mundo e muito se perdeu por falta da tradição da escrita nos nativos brasileiros.</span></p><p dir="ltr" style="text-align: left; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline;">Acho até que seriamos melhores humanos se tivéssemos todo o conhecimento que eles tinham junto com o conhecimento que possuímos hoje em dia.</span></p><p dir="ltr" style="text-align: left; margin-top: 0pt; margin-bottom: 0pt;"><span style="vertical-align: baseline;">Por fim, nos conheceríamos mais se tivéssemos a mente mais aberta a conhecer mais sobre nossos antepassados; o que faziam, porque faziam, no que acreditavam e porque acreditavam naquilo...</span></p><span style="vertical-align: baseline;"><p style="text-align: left;">E em contra proposta deveríamos fazer o mesmo conosco mesmos: o que fazermos, porque fazemos, no que acreditamos, porque acreditamos, o que deixaremos para o futuro de bom e de ruim...</p></span>', 0, 'Steph Hoel', '2016-08-11', 'publicado');
